                <h2 class="text-2xl text-start">EL DÍA DEL INGENIERO</h2>
            </div>
            <p class="font-thin mt-2 text-black text-2xl">
                Se seleccionó el 1 de julio debido a que en 1776, se expidió la Real Cédula para la creación del Real Tribunal de Minería en México. Que dio origen a la fundación del Real Seminario de Minería, donde se gestaron las primeras escuelas de Ingeniería en América.
